export const loadRemoteIcon: (loginWin: BrowserWindow, systemUrlDb: Nedb<DbSystem>) => TrayIconType | undefined = (loginWin, systemUrlDb) => {
  loginWin.webContents.send(RemoteEventNames.loginLoading, {
    error: false,
    result: "载入托盘图标..."
  } as EventReturn<string>);
  return testIcon;

};

const loadWinTray: (loginWin: BrowserWindow, systemUrlDb: Nedb<DbSystem>) => boolean = (loginWin, systemUrlDb) => {

  loginWin.webContents.send(RemoteEventNames.loginLoading, {
    error: false,
    result: "载入基础托盘..."
  } as EventReturn<string>);
  return false;

};
const loadLinuxTray: (loginWin: BrowserWindow, systemUrlDb: Nedb<DbSystem>) => Promise<boolean> = async (loginWin, systemUrlDb) => {

  loginWin.webContents.send(RemoteEventNames.loginLoading, {
    error: false,
    result: "载入悬浮托盘..."
  } as EventReturn<string>);

  const eventData = await loadFloatTray(systemUrlDb);
  if (eventData.error) {
    loginWin.webContents.send(RemoteEventNames.loginLoading, {
      error: true,
      err: {
        message: eventData.err!.message
      }
    } as EventReturn<void>);
    return false;
  }

  return true

};

const loadChatMain: (systemUrlDb: Nedb<DbSystem>) => Promise<EventReturn<boolean>> = systemUrlDb => {
  return new Promise<EventReturn<boolean>>((resolve, reject) => {
    systemUrlDb.findOne<DbSystem>({localType: "chatMain"} as DbSystem, async (err, document) => {
      if (err) {
        resolve({
          error: true,
          err
        } as any);
        return
      }

      try {
        const ajaxRequest = ping(document.url);
        const res = await fetch(ajaxRequest.url.substring(2), {method: "post"});
        if (res.status != 200) {
          resolve({
            error: true,
            err: {
              message: "连接通信主窗体服务失败!"
            }
          } as EventReturn<boolean>);
          return;
        }
        const tmpRes = await res.json();
        if (tmpRes.error || tmpRes.result != "pong") {
          resolve({
            error: true,
            err: {
              message: "通信主窗体  => 连接服务器失败!"
            }
          } as EventReturn<boolean>);
          return;
        }

        if (chatMainWin) {
          chatMainWin.show();
          resolve({
            error: false,
            result: true
          } as EventReturn<boolean>);
          return;
        }

        chatMainWin = new BrowserWindow({
          webPreferences: {
            nodeIntegration: true
          },
          width: 320,
          height: 620,
          frame: false,
          minWidth: 320,
          minHeight: 620,
          transparent: false,
          show: false
        });

        chatMainWin.webContents.openDevTools();
        chatMainWin.setSkipTaskbar(true);
        const chatMainLoading: (event: IpcMainEvent, args: any) => void = (event, args) => {
          if (args) {
            resolve({
              error: true,
              err: {
                message: "通信主窗体  => " + args
              }
            } as EventReturn<boolean>);
            try {
              chatMainWin!.close();
            } catch (e) {

            }
            chatMainWin = undefined;
            return
          }
          addMessagePush(chatMainWin as BrowserWindow);
          resolve({
            error: false
          } as any)
        };
        ipcMain.once(RemoteEventNames.chatMainLoading, chatMainLoading);

        try {
          await chatMainWin.loadURL('http://localhost:6062/')
        } catch (e) {
          ipcMain.removeListener(RemoteEventNames.chatMainLoading, chatMainLoading)
          try {
            floatTrayWin!.close();
          } catch (e) {

          }
          floatTrayWin = undefined;
          resolve({
            error: true,
            err: {
              message: "加载通信组件失败,地址不可用"
            }
          } as EventReturn<boolean>);
          return;
        }


      } catch (e) {
        let message = "通信主窗体 ===> " + e.message;
        if (e.code && e.code == 12) {
          message = "通信主窗体 => 连接服务失败！"
        } else if (e.data && e.data.msg) {
          message = "通信主窗体 => " + e.data.msg;
        }
        resolve({
          error: true,
          err: {
            message
          }
        } as EventReturn<boolean>)
      }

    })
  })
};

const addMessagePush: (win: BrowserWindow) => void = (win) => {
  if (!(global as any).allRecevice) {
    (global as any).allRecevice = [];
  }
  (global as any).allRecevice.push(win);
};

const loadFloatTray: (systemUrlDb: Nedb<DbSystem>) => Promise<EventReturn<boolean>> = (systemUrlDb) => {
  return new Promise<EventReturn<boolean>>((resolve, reject) => {
    systemUrlDb.findOne<DbSystem>({localType: "floatTray"} as DbSystem, async (err, doc) => {
      if (err) {
        resolve({
          error: true,
          err: err
        } as EventReturn<boolean>);
        return
      }


      try {
        const ajaxRequest = ping(doc.url);
        const res = await fetch(ajaxRequest.url.substring(2), {method: "post"});
        if (res.status != 200) {
          resolve({
            error: true,
            err: {
              message: "连接悬浮托盘服务失败!"
            }
          } as EventReturn<boolean>);
          return;
        }
        const tmpRes = await res.json();
        if (tmpRes.error || tmpRes.result != "pong") {
          resolve({
            error: true,
            err: {
              message: "悬浮托盘  => 连接服务器失败!"
            }
          } as EventReturn<boolean>);
          return;
        }
        if (floatTrayWin) {
          floatTrayWin.show();
          resolve({
            error: false,
            result: true
          } as EventReturn<boolean>);
          return;
        }
        floatTrayWin = new BrowserWindow({
          webPreferences: {
            nodeIntegration: true
          },
          width: 64, height: 64, resizable: false, show: false, alwaysOnTop: true, frame: false
        });

        floatTrayWin.setSkipTaskbar(true);
        const floatTrayLoadingEvent: (event: IpcMainEvent, args: any) => void = (event, args) => {
          event.returnValue = testIcon;
          resolve({
            error: false,
            result: true
          } as EventReturn<boolean>);
        };

        ipcMain.once(RemoteEventNames.floatTrayLoading, floatTrayLoadingEvent);

        try {
          await floatTrayWin.loadURL("http://192.168.100.20:6061");
        } catch (e) {
          ipcMain.removeListener(RemoteEventNames.floatTrayLoading, floatTrayLoadingEvent);
          floatTrayWin.close();
          floatTrayWin = undefined;
          resolve({
            error: true,
            err: {
              message: "加载托盘组件失败,地址不可用"
            }
          } as EventReturn<boolean>);
          return;
        }

      } catch (e) {
        let message = "悬浮托盘 ===> " + e.message;
        if (e.code && e.code == 12) {
          message = "悬浮托盘 => 连接服务失败！"
        } else if (e.data && e.data.msg) {
          message = "悬浮托盘 => " + e.data.msg;
        }
        resolve({
          error: true,
          err: {
            message
          }
        } as EventReturn<boolean>)
      }
    })
  });
};

export const loadTray: (userInfo: UserInfo, loginWin: BrowserWindow, systemUrlDb: Nedb<DbSystem>) => Promise<boolean> = async (userInfo, loginWin, systemUrlDb) => {
  loginWin.webContents.send(RemoteEventNames.loginLoading, {
    error: false,
    result: "载入通信主体组件..."
  } as EventReturn<string>);

  const chatEventData = await loadChatMain(systemUrlDb);
  if (chatEventData.error) {
    loginWin.webContents.send(RemoteEventNames.loginLoading, chatEventData);
    return false;
  }

  loginWin.webContents.send(RemoteEventNames.loginLoading, {
    error: false,
    result: "载入托盘组件..."
  } as EventReturn<string>);

  const platform = os.platform();
  const icons = await loadRemoteIcon(loginWin, systemUrlDb);
  if (!icons) {
    return false;
  }

  let res;
  if (platform == "linux") {
    res = await loadLinuxTray(loginWin, systemUrlDb);
  } else {
    res = await loadWinTray(loginWin, systemUrlDb);
  }

  if (!res) {

    try {
      if (chatMainWin) {
        chatMainWin.close()
      }
    } catch (e) {
    }

    try {
      if (floatTrayWin) {
        floatTrayWin.close();
      }
    } catch (e) {

    }
    chatMainWin = undefined;
    floatTrayWin = undefined;

    return res;
  }

  floatTrayWin!.show();
  chatMainWin!.show();

  return res;

};
